public TestBeanOverrideHandler createHandler(Annotation overrideAnnotation, Class<?> testClass, Field field) {
	if (!(overrideAnnotation instanceof TestBean testBean)) {
		throw new IllegalStateException("Invalid annotation passed to %s: expected @TestBean on field %s.%s"
				.formatted(getClass().getSimpleName(), field.getDeclaringClass().getName(), field.getName()));
	}

	String beanName = (!testBean.name().isBlank() ? testBean.name() : null);
	String methodName = testBean.methodName();
	BeanOverrideStrategy strategy = (testBean.enforceOverride() ? REPLACE : REPLACE_OR_CREATE);

	Method factoryMethod;
	if (!methodName.isBlank()) {
		// If the user specified an explicit method name, search for that.
		factoryMethod = findTestBeanFactoryMethod(field.getDeclaringClass(), field.getType(), methodName);
	}
	else {
		// Otherwise, search for candidate factory methods whose names match either
		// the field name or the explicit bean name (if any).
		List<String> candidateMethodNames = new ArrayList<>();
		candidateMethodNames.add(field.getName());

		if (beanName != null) {
			candidateMethodNames.add(beanName);
		}
		factoryMethod = findTestBeanFactoryMethod(field.getDeclaringClass(), field.getType(), candidateMethodNames);
	}

	return new TestBeanOverrideHandler(
			field, ResolvableType.forField(field, testClass), beanName, strategy, factoryMethod);
}

public List<BeanOverrideHandler> createHandlers(Annotation overrideAnnotation, Class<?> testClass) {
	if (overrideAnnotation instanceof MockitoBean mockitoBean) {
		Class<?>[] types = mockitoBean.types();
		Assert.state(types.length > 0,
				"The @MockitoBean 'types' attribute must not be empty when declared on a class");
		Assert.state(mockitoBean.name().isEmpty() || types.length == 1,
				"The @MockitoBean 'name' attribute cannot be used when mocking multiple types");
		List<BeanOverrideHandler> handlers = new ArrayList<>();
		for (Class<?> type : types) {
			handlers.add(new MockitoBeanOverrideHandler(ResolvableType.forClass(type), mockitoBean));
		}
		return handlers;
	}
	else if (overrideAnnotation instanceof MockitoSpyBean mockitoSpyBean) {
		Class<?>[] types = mockitoSpyBean.types();
		Assert.state(types.length > 0,
				"The @MockitoSpyBean 'types' attribute must not be empty when declared on a class");
		Assert.state(mockitoSpyBean.name().isEmpty() || types.length == 1,
				"The @MockitoSpyBean 'name' attribute cannot be used when mocking multiple types");
		List<BeanOverrideHandler> handlers = new ArrayList<>();
		for (Class<?> type : types) {
			handlers.add(new MockitoSpyBeanOverrideHandler(ResolvableType.forClass(type), mockitoSpyBean));
		}
		return handlers;
	}
	throw new IllegalStateException("""
			Invalid annotation passed to MockitoBeanOverrideProcessor: \
			expected either @MockitoBean or @MockitoSpyBean on test class %s"""
				.formatted(testClass.getName()));
}

